import React from 'react';
import './Layout.css';

const Layout = () => {
  return (
    <div className="layout">
      <div className="layout-section">Section 1</div>
      <div className="layout-section">Section 2</div>
      <div className="layout-section">Section 3</div>
    </div>
  );
};

export default Layout;
